import React from "react";
import "./activityPageComponent.scss";

// eslint-disable-next-line react/prop-types
const ActivityPageComponent = ({ onClickHandler }) => {
  return (
    <div className="friends-wrapper">
      <blockquote
        class="tiktok-embed"
        cite="https://www.tiktok.com/@seth.duty/video/6783732984022371590"
        data-video-id="6783732984022371590"
        style="max-width: 605px;min-width: 325px;"
      ></blockquote>
      <script async src="https://www.tiktok.com/embed.js"></script>
    </div>
  );
};
export default ActivityPageComponent;
